"use strict";var MiResume=Vue.extend({data:function(){return{resume:null,filtered:null,actives:[]}},methods:{listOfNames:function(e){if(e){var i=[].concat(e);return this.sortByName(i),i.map(function(e){return e.name}).join(", ")}},sortByName:function(e){return e.sort(function(e,i){var t=e.name.toLowerCase(),n=i.name.toLowerCase();return n>t?-1:t>n?1:0})},sortByPriority:function(e){return e.sort(function(i,t){var n=i.priority||e.length,s=t.priority||e.length;return s>n?-1:n>s?1:0})},topPicks:function(e){var i=arguments.length<=1||void 0===arguments[1]?3:arguments[1];if(e){var t=[].concat(e);return this.sortByPriority(t),this.listOfNames(t.slice(0,i-1))+", and "+this.listOfNames(t.slice(i-1,i))}},replaceStrings:function(e,i){if(e&&i){var t=new RegExp("\\$\\{("+Object.keys(i).join("|")+")\\}","ig");return e.replace(t,function(e,t){return i[t]})}},className:function(e){return e.toLowerCase().replace(" ","-").replace(".","")},isActive:function(e){return this.actives.indexOf(e)>=0},toggleActive:function(e){return this.isActive(e)?this.actives.splice(this.actives.indexOf(e),1):this.actives.push(e)}},init:function(){var e=this;fetch("resume.json").then(function(e){return e.json()}).then(function(i){e.resume=i,e.filtered={};for(var t in e.resume)switch(t){case"experience":case"education":case"volunteering":e.filtered[t]=e.resume[t].filter(function(e){return e.relevant!==!1});break;case"about":e.filtered[t]=[];for(var n=Math.ceil(e.resume[t].length/2),s=0;s<e.resume[t].length;s++){var r=s%2===0?s/2:n+Math.floor(s/2);e.filtered[t][s]=e.resume[t][r]}break;default:e.filtered[t]=e.resume[t]}})},template:'\n<div>\n	<header class="flex-row flex-align-center">\n		<div class="flex-grow flex-shrink padding-right" style="flex-basis: 50%;">\n			<h1>{{ resume.info.name }}</h1>\n			<p>{{ resume.info.description }}</p>\n		</div>\n		<figure>\n			<img :src="resume.info.image" width="128" height="128" />\n		</figure>\n	</header>\n	<article class="about">\n		<header>\n			<h2>about</h2>\n		</header>\n		<ul class="flex-row">\n			<li v-for="skill of filtered.about" class="iconed">\n				<i class="fa fa-{{ skill.icon }}" :title="skill.name"></i>\n				<span>{{ skill.description + (skill.items ? topPicks(skill.items) + \'.\' : \'\') }}</span>\n				<button v-if="skill.items" @click="toggleActive(skill)" class="btn more"><i class="fa fa-{{ isActive(skill) ? \'minus\' : \'plus\' }}-circle"></i> {{ skill.items.length - 3 }} {{ isActive(skill) ? \'less\' : \'more\' }}</button>\n				<ul v-if="skill.items" v-show="isActive(skill)" class="more">\n					<li v-for="item of skill.items">{{ item.name }}<sup v-if="item.priority" class="color-primary">&star;</sup></li>\n				</ul>\n			</li>\n		</ul>\n	</article>\n	<article class="social">\n		<header>\n			<h2>social</h2>\n		</header>\n		<ul class="flex-row flex-justify-around">\n			<li v-for="item of resume.social">\n				<a :href="item.url" :title="item.name" target="_blank" :class="\'fa fa-\' + className(item.name)"></a>\n			</li>\n		</ul>\n	</article>\n	<article v-for="section of [\'experience\',\'education\',\'volunteering\']">\n		<header>\n			<h2>{{ section }}</h2>\n		</header>\n		<ol>\n			<li v-for="item of (isActive(section) ? resume : filtered)[section]">\n				<header>\n					<strong v-if="item.title">{{ item.title }}</strong>\n					<a v-if="item.url" :href="item.url" target="_blank">{{ item.name }}</a>\n					<small v-if="item.duration">{{ item.duration }}</small>\n				</header>\n				<div v-if="item.description">{{ item.description }}</div>\n			</li>\n		</ol>\n		<footer>\n			<button v-if="filtered[section].length < resume[section].length" @click="toggleActive(section)" class="btn more"><i class="fa fa-{{ isActive(section) ? \'minus\' : \'plus\' }}-circle"></i> {{ resume[section].length - filtered[section].length }} {{ isActive(section) ? \'less\' : \'more\' }}</button>\n		</footer>\n	</article>\n	<article>\n		<header>\n			<h2>references</h2>\n		</header>\n		<ul>\n			<li>\n				Available on <a :href="\'mailto:\' + resume.info.email" target="_blank">request</a>.\n			</li>\n		</ul>\n	</article>\n</div>'}),MiApp=new Vue({el:"#app",components:{MiResume:MiResume},template:"\n<main>\n	<mi-resume></mi-resume>\n</main>"});